#!/usr/bin/php
<?php
/*
   This file will call the template file to create the values to forward to graphite.
   The logic is that this is called with host, data to be parsed, and rawOid value,
   the oid value is used to figure out which template will give us our return data.
   Once the data has been returned, then this will finally forward our metrics to Graphite
*/

/*
  The next version of this should have the graphite object passed as well
  so we do not need to create a second object here for something that exists
  in the parent calling script
*/

/*
  This metric save is slightly different than others.  This is due to needing the
  checkAction oid value for SNMP.  NRPE and others do not have this requirement.
*/

require_once __DIR__ . '/../src/Infrastructure/Shared/Functions/daemonFunctions.php';

class MetricParsing {
  public $hostname;
  public $dataToBeInserted;
  public $checkName;
  public $returnArrayValues;

  public function __construct() {}

  // Define the template we are using here
  public function parseRaw($hostname, $dataToBeInserted, $checkName, $checkAction = null, $type = null, $cycle = null) {
    if ( ! is_null($type) && $type == "nrpe" ) {
      if (file_exists(__DIR__ . "/template_" . $type . ".php")) {
        // This should return our array
        echo "Found template file: " . __DIR__ . "/template_" . $type . ".php\n";
        require_once __DIR__ . "/template_" . $type . ".php";
        return 0;
      }
      else {
        // Return that we failed to find a template file
        echo "No template file found at: " . __DIR__ . "/template_" . $type . ".php\n";
        return 1;
      }
    }
    elseif ( ! is_null($type) && $type == "poller" ) {
      if (file_exists(__DIR__ . "/template_" . $type . ".php")) {
        require_once __DIR__ . "/template_" . $type . ".php";
        return 0;
      }
      else {
        return 1;
      }
    }
    elseif ( $type = "shell") {
      if (file_exists(__DIR__ . "/graphite/shell/template_default.php")) {
        // This should return our array
        echo "Found template file: " . __DIR__ . "/graphite/shell/template_default.php\n";
        require_once __DIR__ . "/graphite/shell/template_default.php";
        return 0;
      }
      else {
        // Return that we failed to find a template file
        echo "No template file found at: " . __DIR__ . "/graphite/shell/template_default.php\n";
        return 1;
      }
    }
    elseif (null == $checkAction) {
      // $checkAction is NOT defined.
      // we should NOT be dealing with SNMP OID values in the normal SNMP way (if at all).
      // The template will have to do heavy lifting at this point based on $checkName
      if (file_exists(__DIR__ . "/template_" . $checkName . ".php")) {
        // This should return our array
        echo "Found template file: " . __DIR__ . "/template_" . $checkName . ".php\n";
        require_once __DIR__ . "/template_" . $checkName . ".php";
        return 0;
      }
      else {
        // Return that we failed to find a template file
        echo "No template file found at: " . __DIR__ . "/template_" . $checkName . ".php\n";
        return 1;
      }
    }
    else {
      // $checkAction IS defined, so we are working with a normal SNMP oid
      if (file_exists(__DIR__ . "/template_" . $checkAction . ".php")) {
        // This should return our array
        echo "Found template file: " . __DIR__ . "/template_" . $checkAction . ".php\n";
        require_once __DIR__ . "/template_" . $checkAction . ".php";
        return 0;
      }
      else{
        // Return that we failed to find a template file
        echo "No template file found at: " . __DIR__ . "/template_" . $checkAction . ".php\n";
        return 1;
      }
    }
  }
}

function sendMetricToGraphiteTest($hostname, $dataToBeInserted, $checkName, $checkAction = null, $type = null, $cycle = null) {
  if (! isset($metricData)) {
    // This should make an object to use for metrics
    $metricData=new MetricParsing();
  }
  // We should now have a basic object called $metricData created
  // parseRaw will return 0 or 1 if it finds the template
  if ( null === $checkAction ) {
    // If no checkAction is defined, treat as a generic checkName
    $noise = $metricData->parseRaw($hostname, $dataToBeInserted, $checkName, null, $type);
  }
  else {
    // We know this is going to be SNMP style.
    $noise = $metricData->parseRaw($hostname, $dataToBeInserted, $checkName, $checkAction, $type);
  }

  if ( $noise == 1) {
    echo "NOISE " . $noise . "\n";
    echo "template did not return an array.  Instead, it could not find or load the template file\n";
    return 1;
  }
 
  $returnArray = $metricData->returnArrayValues;
  // print_r($returnArray); // DEBUG

  if ( ! is_array($returnArray)) {
    echo "is_array shows no array in returnArray \n";
    return 1;
  }
  elseif ($returnArray == 1) {
    echo "returnArray returned a result code 1.  FATAL \n";
    return 1;
  }

  echo "Would have pushed: \n";
  foreach ($returnArray as $k => $v) {
    echo "KEY: " . $k . " VALUE: " . $v . "\n";
  }

/*
  // Enable only if testing end-2-end
  if (! isset($graphitePush)) {
    require_once __DIR__ . '/../app/Graphite.php';
    $graphitePush=new Graphite();
  }

  foreach ($returnArray as $k => $v) {
    $graphitePushNoise=$graphitePush->testMetric( $k, $v);
  }
*/
  // Do NOT allow memory bleeds.  Unset stuff ASAP
  unset ($returnArray);
  unset ($metricData->returnArrayValues);
  return 0;
}

